import React from 'react';
import { NavLink } from 'react-router-dom';
import './mobile-menu.css';

const MobileMenu = ({ navLinks, isOpen, toggleMenu }) => {
  return (
    <div className={"mobile__menu ${isOpen ? 'open' : ''}"}>
      <div className="menu__wrapper">
        <div className="menu__header">
          <button className="close__btn" onClick={toggleMenu}>
            <i className="ri-close-line"></i>
          </button>
        </div>
        <ul className="menu__items">
          {navLinks.map((item, index) => (
            <li key={index}>
              <NavLink to={item.path} activeClassName="active__link" onClick={toggleMenu}>
                {item.display}
              </NavLink>
            </li>
          ))}
          <li>
            <NavLink to="/profile" activeClassName="active__link" onClick={toggleMenu}>
              Profile
            </NavLink>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default MobileMenu;
